dition)\n            train = df.filter(~condition)\n\n            for j in range(numModels):\n                paramMap = epm[j]\n                model = est.fit(train, paramMap)\n                # TODO: duplicate evaluator to take extra params from input\n                metric = eva.evaluate(model.transform(validation, paramMap))\n                metrics[j] += metric\n\n                avgSoFar = metrics[j] / foldNum\n                print(\"params: %s\\t%s: %f\\tavg: %f\" % (  \n                  {param.name: val for (param, val) in paramMap.items()},\n                    metricName, metric, avgSoFar))\n\n                for (param, val) in paramMap.items():\n                  a.append(param.name)\n                  b.append(val)\n                  c.append(metric)\n                \n        if eva.isLargerBetter():\n            bestIndex = np.argmax(metrics)\n        else:\n            bestIndex = np.argmin(metrics)\n\n        bestParams = epm[bestIndex]\n        bestModel = est.fit(dataset, bestParams)\n        avgMetrics = [m / nFolds for m in metrics]\n        bestAvg = avgMetrics[bestIndex]\n        print(\"Best model:\\nparams: %s\\t%s: %f\" % (\n            {param.name: val for (param, val) in bestParams.items()},\n            metricName, bestAvg))\n        \n        return self._copyValues(CrossValidatorModel(bestModel, avgMetrics))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":"<span class=\"ansired\">IndentationError</span><span class=\"ansired\">:</span> unindent does not match any outer indentation level","error":"<div class=\"ansiout\"><span class=\"ansicyan\">  File </span><span class=\"ansigreen\">&quot;&lt;command-2307478056950140&gt;&quot;</span><span class=\"ansicyan\">, line </span><span class=\"ansigreen\">53</span>\n<span class=\"ansiyellow\">    for i in range(0, len(a), 2):</span>\n<span class=\"ansi v>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1523722792939,"submitTime":1523722792898,"finishTime":1523722793012,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"a7e79cea-65ff-4869-9de9-6efe755bd2c2"},{"version":"CommandV1","origId":2307478056950133,"guid":"450de483-8636-4029-b018-d8de79977f29","subtype":"command","commandType":"auto","position":5.077619876712561,"command":"class CrossValidatorVerbose(CrossValidator):\n\n    def _fit(self, dataset):\n        est = self.getOrDefault(self.estimator)\n        epm = self.getOrDefault(self.estimatorParamMaps)\n        numModels = len(epm)\n\n        eva = self.getOrDefault(self.evaluator)\n        metricName = eva.getMetricName()\n\n        nFolds = self.getOrDefault(self.numFolds)\n        seed = self.getOrDefault(self.seed)\n        h = 1.0 / nFolds\n\n        randCol = self.uid + \"_rand\"\n        df = dataset.select(\"*\", rand(seed).alias(randCol))\n        metrics = [0.0] * numModels\n\n        for i in range(nFolds):\n            foldNum = i + 1\n            print(\"Comparing models on fold %d\" % foldNum)\n\n            validateLB = i * h\n            validateUB = (i + 1) * h\n            condition = (df[randCol] >= validateLB) & (df[randCol] < validateUB)\n            validation = df.filter(condition)\n            train = df.filter(~condition)\n\n            for j in range(numModels):\n                paramMap = epm[j]\n                model = est.fit(train, paramMap)\n                # TODO: duplicate evaluator to take extra params from input\n                metric = eva.evaluate(model.transform(validation, paramMap))\n                metrics[j] += metric\n\n                avgSoFar = metrics[j] / foldNum\n                print(\"params: %s\\t%s: %f\\tavg: %f\" % (\n                    {param.name: val for (param, val) in paramMap.items()},\n                    metricName, metric, avgSoFar))\n\n        if eva.isLargerBetter():\n            bestIndex = np.argmax(metrics)\n        else:\n            bestIndex = np.argmin(metrics)\n\n        bestParams = epm[bestIndex]\n        bestModel = est.fit(dataset, bestParams)\n        avgMetrics = [m / nFolds for m in metrics]\n        bestAvg = avgMetrics[bestIndex]\n        print(\"Best model:\\nparams: %s\\t%s: %f\" % (\n            {param.name: val for (param, val) in bestParams.items()},\n            metricName, bestAvg))\n\n        return self._copyValues(CrossValidatorModel(bestModel, avgMetrics))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1523734956194,"submitTime":1523734956155,"finishTime":1523734956322,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"2bb3c2ee-1f44-4a86-a5d5-5090f2899ed4"},{"version":"CommandV1","origId":2833687394643296,"guid":"f7243539-a019-499d-8a4f-0b27d7cb0414","subtype":"command","commandType":"auto","position":5.077619969844818,"command":"finalModelFit","commandVersion":0,"s
